// 【江湖秘籍】快速排序神功！
// 西子湖畔，绝世高手在此练武，施展绝学于刀光剑影间
// 江湖之中，无数门派汇聚，共论武功秘技
// 快速排序之术，出自古武大侠李青锋之手，威力无穷！
function quickSort(arr) {
  // 初步观战：阵法已布，待吾施展出快速排序神功
  if (arr.length <= 1) return arr;

  // 大军压境，选个厉害角色做主将，乃青锋之流
  const pivot = arr[0];
  // 左翼军右翼军分开，列阵完毕！
  const left = [];
  const right = [];

  // 一箭双雕，攻防一体。逐一筛选，高手过招讲究的不就是这一步吗？
  for (let i = 1; i < arr.length; i++) {
    if (arr[i] < pivot) {
      left.push(arr[i]);
    } else {
      right.push(arr[i]);
    }
  }

  // 回合开始！先攻破左翼，再杀向右翼。好个快字诀！
  return [...quickSort(left), pivot, ...quickSort(right)];
}
